import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Navbar from './navbar/navbar'
import Project from './project_tab/project_tab';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Navbar />
    <Project />
    <img alt ='test'></img>
  </React.StrictMode>
);
